import React from "react";

const TableCell = ({
   Renderer,
   isNearest,
   cellMouseEnter,
   cellMouseLeave,
   ...props
}) => {
   return (
      <td>
         <Renderer {...props} />
      </td>
   );
};

export default TableCell;
